let teams = [
  {
    sekolah: "SMP Mutiara Singaraja",
    logo: "data:image/png;base64,",
  },
  { sekolah: "SMP Negeri 3 Sawan", logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ-LWGnsXwG3tkm-WhjNv6vczLf0VG0tGYEAoYJbkfxRw&s" },
  {
    sekolah: "SMP Negeri 3 Singaraja",
    logo: "data:image/png;base64,",
  },
  {
    sekolah: "SMP Negeri 2 Banjar",
    logo: "data:image/jpeg;base64,",
  },
  { sekolah: "SMP Negeri 6 Kubutambahan", logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ-LWGnsXwG3tkm-WhjNv6vczLf0VG0tGYEAoYJbkfxRw&s" },
  {
    sekolah: "SMP Negeri 7 Banjar",
    logo: "data:image/jpeg;base64,",
  },
];

// Beep Sound Effect
function beep() {
  let audio = new Audio(
    "data:audio/wav;base64,"
  );
  audio.play();
}

// Array Shuffle Function
function shuffle(array) {
  return array
    .map((value) => ({ value, sort: Math.random() }))
    .sort((a, b) => a.sort - b.sort)
    .map(({ value }) => value);
}

// Shuffle Button Event
document.querySelector("#shuffle").addEventListener("click", function () {
  beep();
  this.remove();
  let i = 0;
  let interval = setInterval(() => {
    teams = shuffle(teams);
    document.querySelectorAll(".group ul li").forEach((e, i) => {
      e.childNodes[3].innerHTML = teams[i].sekolah;
      e.childNodes[1].setAttribute("src", teams[i].logo);
    });
    i++;
    if (i === 2) {
      beep();
      i = 0;
    }
  }, 50);
  setTimeout(() => {
    clearInterval(interval);
  }, 10000);
});
